import { io } from 'socket.io-client'
import React from 'react'

const BlitzBout = () => {

    const blitzBoutMainWrapperStyle = {

        display: "flex",
        paddingTop: "5%",
        flexDirection: "column",
        alignItems: "center",
        backgroundColor: "#e3e3ed",
        fontSize: "2.5em",
        fontFamily: "poppins"

    }

    const blueEmphasisStyle = {
        color: "#334173",
        fontWeight: "bold"
    }
    /*
     React.useEffect(()=>{
        const socket = io('http://localhost:8080')
     
     },[])    
     */

    return (

        <div id="blitzBout">

            <main id="blitzBoutMainWrapper" style={blitzBoutMainWrapperStyle}>
                <h1><span style={blueEmphasisStyle}>BlitzBout</span>.</h1>
            </main>

        </div>

    );

};

export default BlitzBout;
